import React, { Component } from 'react';
import { Box, TextField } from '@material-ui/core';

const styles = {
  container: {
    width: '100%',
    height: '100%',
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'center',
  },
  username: {
    marginRight: 200,
    marginLeft: 200,
    marginBottom: 30,
  },
  password: {
    marginRight: 200,
    marginLeft: 200,
  },
};
export default class LoginBox extends Component {
  render() {
    return (
      <Box style={styles.container}>
        {/*    <Box
          style={{
            width: '100%',
            alignContent: 'center',
            justifyContent: 'center',
            display: 'flex',
          }}
        >
          <p>Login</p>
        </Box> */}
        <Box style={styles.loginContainer}>
          {' '}
          <TextField style={styles.username} placeholder="Email" />
          <TextField style={styles.password} placeholder="password" />
        </Box>
      </Box>
    );
  }
}
